import React from 'react';
import './CIBILScoreGuide.css'; // Ensure the CSS file is in the same directory

const CIBILScoreGuide = () => {
  return (
    <div className="cibil-score-guide">
      <h2>Your CIBIL Score: Quick Guide</h2>
      <div className="cards-container">
        <div className="card">KNOW YOUR CIBIL SCORE?</div>
        <div className="card">WHAT IS CREDIT REPAIR?</div>
        <div className="card">WHAT IS A CREDIT REPORT?</div>
        <div className="card">GOOD CIBIL SCORE FOR LOANS?</div>
        <div className="card">WHAT IS A BAD CREDIT SCORE?</div>
        <div className="card">HOW TO IMPROVE CIBIL SCORE?</div>
      </div>
    </div>
  );
};

export default CIBILScoreGuide;
